DELIMITER $$
--
-- Procedures
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateAllIndicatorValues` ()   BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE v_IndicatorID INT;
    DECLARE cur CURSOR FOR SELECT IndicatorID FROM indicator_targets;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN cur;
    read_loop: LOOP
        FETCH cur INTO v_IndicatorID;
        IF done THEN
            LEAVE read_loop;
        END IF;

        IF v_IndicatorID = 1 THEN
            -- Update IndicatorValue for IndicatorID = 1
            UPDATE indicator_targets
            SET IndicatorValue = (
                SELECT SUM(`source`.`Num_Students_With_Career_Goals_And_Interests`) AS `sum`
                FROM (
                    SELECT
                        COUNT(*) AS Num_Students_With_Career_Goals_And_Interests
                    FROM
                        candidates
                    WHERE
                        Skills IS NOT NULL
                        OR Industry_Specific_Skills IS NOT NULL
                        OR IT_Related_Skills IS NOT NULL
                        OR Certifications IS NOT NULL
                        OR Field_Of_Study IS NOT NULL
                ) AS `source`
            )
            WHERE IndicatorID = v_IndicatorID;
        ELSEIF v_IndicatorID = 2 THEN
            -- Update IndicatorValue for IndicatorID = 2
            UPDATE indicator_targets
            SET IndicatorValue = (
                SELECT COUNT(*) AS EstimatedAlumniCount
                FROM candidates
                WHERE (
                  Year_of_graduation IS NOT NULL  /* Graduates are assumed to be potential members */
                  OR (
                    Employment_Status = 'Employed'  /* Employed might indicate Alumni engagement */
                    AND Dereja_web_profile_completion IN ('Yes', 'Partial') /* Consider only partially or fully completed profiles */
                  )
                  OR (
                    Work_Experience = 'Yes'  /* Work experience could suggest Alumni engagement */
                    AND (
                      Employment_Company LIKE '%[Institution Name]%'  /* Look for company name containing the institution name */
                      OR Employment_Company LIKE '%Alumni%'  /* Or containing "Alumni" */
                    )
                  )
                  OR (
                    Attend_Employability_Skill = 'Yes' OR Job_Fair IN ('Yes', 'Attended')  /* Participation in events might indicate engagement */
                    AND Year_of_graduation IS NOT NULL  /* Focus on recent graduates for event participation */
                  )
                  OR (
                    Intervention LIKE '%Alumni%' OR Campaign LIKE '%Alumni%'  /* Campaigns targeting Alumni */
                    AND Year_of_graduation IS NOT NULL  /* Focus on recent graduates for targeted campaigns */
                  )
                )
            )
            WHERE IndicatorID = v_IndicatorID;
        ELSEIF v_IndicatorID = 3 THEN
            -- Update IndicatorValue for IndicatorID = 3
            UPDATE indicator_targets
            SET IndicatorValue = (
                SELECT COUNT(*) AS Total_Yes_Count
                FROM candidates
                WHERE Campaign = 'Yes'
            )
            WHERE IndicatorID = v_IndicatorID;
        END IF;

    END LOOP;
    CLOSE cur;
END$$

DELIMITER ;

