(826, '2021-07-12 08:58:22', 'I have created a Rest API view that displays data when the user provides a filter on the view page. This is a great new feature for 10.5!<br><br>What is the recommended way to save that API view data to the database? In my application I would like to save data provided by the API view into my database. I am very familiar with how to do this with regular tables but not so familiar with the REST API views. I am using PHPRunner 10.5 build 36520 x64.<br>Thank you in advance for any help!', 'testdevmail2@mail.com', 'Can 10.5 insert data to a table from an API View', NULL, '2021-07-12 08:58:22', 'customer@test.com', 'Alina Molchanova', NULL, '', NULL, NULL, NULL, 1, 1, 1, 5),
(827, '2021-07-12 08:59:08', 'does anyone know if it is possible to connect to a SQL linked server? i have looked and tried but the SQL linked server doesn\'t show up.<br>Thanks in advance', 'testdevmail2@mail.com', 'PHPRunner Connections', NULL, '2021-07-12 08:59:08', 'customer@test.com', 'Alina Molchanova', NULL, '', NULL, NULL, NULL, 2, 1, 1, 1),
(828, '2021-07-12 08:59:58', 'This morning when I open my Project, and Build, I receive this error on about 80% of my Tables.<br>I\'m the only one working on the DB, and didn\'t do any changes to the DB or change any passwords for quite some time.<br>php error happened<br>Technical information<br><br>Error type 256<br><br>Error description Incorrect table name \'\'<br><br>URL localhost/hisportal/his_employee_list.php?page=list&menuItemId=73<br><br>Error file D:\\xampp\\htdocs\\hisportal\\connections\\Connection.php', 'testdevmail2@mail.com', ' What can cause this PHP errors on almost all Files', NULL, '2021-07-12 08:59:58', 'customer@test.com', 'Alina Molchanova', NULL, '', NULL, NULL, NULL, 3, 1, 1, 1),
(829, '2021-07-12 09:02:41', 'Hello!<br><br>You have 2 backticks instead of table name, in your SQL statement after FROM. It could be that your table names cannot be recognized by the script, hence showed empty string. could it be character encoding issue of your OS, or your table names or field names containing unicode characters. Try to ensure all characters encoding are utf-8 in database.<br>Check Latin vs Unicode issue<br>Try using a 3rd party SQL editor, eg. SQLyog, and connect to your database and see if you can browse the data. Last resort is to export the data and try recreate the database using utf-8.<br><br>> This morning when I open my Project, and Build, I receive this error on about 80% of my Tables.<br>> I\'m the only one working on the DB, and didn\'t do any changes to the DB or change any passwords for quite some time.<br>> php error happened<br>> Technical information<br>> <br>> Error type 256<br>> <br>> Error description Incorrect table name \'\'<br>> <br>> URL localhost/hisportal/his_employee_list.php?page=list&menuItemId=73<br>> <br>> Error file D:\\xampp\\htdocs\\hisportal\\connections\\Connection.php', 'customer@test.com', ' What can cause this PHP errors on almost all Files DSS-TP1MIB', NULL, '2021-07-12 09:02:41', 'testdevmail2@mail.com', NULL, 'Alina Molchanova', '', '', '', NULL, 3, 2, 3, NULL),
(830, '2024-05-29 18:07:14', 'Can you help me', 'test@mail.com', 'Test Ticket', NULL, '2024-05-29 18:07:14', 'michaelktd7@gmail.com', 'John Do', NULL, '', NULL, NULL, NULL, 4, 1, 1, 6);

