INSERT INTO `webreport_sql` (`id`, `sqlname`, `sqlcontent`) VALUES
(1, 'Candidates By DAPP Completed Courses', 'SELECT\n  `candidates`.`DAAP_Completed_Courses` AS `DAAP_Completed_Courses`,\n  COUNT(*) AS `count`\nFROM\n  `candidates`\nGROUP BY\n  `candidates`.`DAAP_Completed_Courses`\nORDER BY\n  `candidates`.`DAAP_Completed_Courses` ASC'),
(2, 'Candidates Disaggregated Report', 'SELECT\n  `candidates`.`Sex` AS `Sex`,\n  MAKEDATE(YEAR(`candidates`.`DOB`), 1) AS `DOB`,\n  `candidates`.`Disability_Status` AS `Disability_Status`,\n  `candidates`.`Region` AS `Region`,\n  `candidates`.`City` AS `City`,\n  `candidates`.`Institution_Name` AS `Institution_Name`,\n  `candidates`.`Education_Level` AS `Education_Level`,\n  MAKEDATE(YEAR(`candidates`.`Year_of_graduation`), 1) AS `Year_of_graduation`,\n  `candidates`.`Field_Of_Study` AS `Field_Of_Study`,\n  `candidates`.`Intervention` AS `Intervention`,\n  `candidates`.`Campaign` AS `Campaign`,\n  `candidates`.`Enrollement_Type` AS `Enrollement_Type`,\n  `candidates`.`Dereja_Services` AS `Dereja_Services`,\n  COUNT(*) AS `count`\nFROM\n  `candidates`\nGROUP BY\n  `candidates`.`Sex`,\n  MAKEDATE(YEAR(`candidates`.`DOB`), 1),\n  `candidates`.`Disability_Status`,\n  `candidates`.`Region`,\n  `candidates`.`City`,\n  `candidates`.`Institution_Name`,\n  `candidates`.`Education_Level`,\n  MAKEDATE(YEAR(`candidates`.`Year_of_graduation`), 1),\n  `candidates`.`Field_Of_Study`,\n  `candidates`.`Intervention`,\n  `candidates`.`Campaign`,\n  `candidates`.`Enrollement_Type`,\n  `candidates`.`Dereja_Services`\nORDER BY\n  `candidates`.`Sex` ASC,\n  MAKEDATE(YEAR(`candidates`.`DOB`), 1) ASC,\n  `candidates`.`Disability_Status` ASC,\n  `candidates`.`Region` ASC,\n  `candidates`.`City` ASC,\n  `candidates`.`Institution_Name` ASC,\n  `candidates`.`Education_Level` ASC,\n  MAKEDATE(YEAR(`candidates`.`Year_of_graduation`), 1) ASC,\n  `candidates`.`Field_Of_Study` ASC,\n  `candidates`.`Intervention` ASC,\n  `candidates`.`Campaign` ASC,\n  `candidates`.`Enrollement_Type` ASC,\n  `candidates`.`Dereja_Services` ASC'),
(3, 'Display All Candidate Table Columns', 'SELECT\n  `candidates`.`CandidateID` AS `CandidateID`,\n  `candidates`.`StudentID` AS `StudentID`,\n  `candidates`.`First_Name` AS `First_Name`,\n  `candidates`.`Middle_Name` AS `Middle_Name`,\n  `candidates`.`Last_Name` AS `Last_Name`,\n  `candidates`.`Sex` AS `Sex`,\n  `candidates`.`DOB` AS `DOB`,\n  `candidates`.`Region` AS `Region`,\n  `candidates`.`City` AS `City`,\n  `candidates`.`Sub_City` AS `Sub_City`,\n  `candidates`.`Zone` AS `Zone`,\n  `candidates`.`House_No` AS `House_No`,\n  `candidates`.`Phone_Number` AS `Phone_Number`,\n  `candidates`.`Phone_Number_Alternate` AS `Phone_Number_Alternate`,\n  `candidates`.`Email_Address` AS `Email_Address`,\n  `candidates`.`Disability_Status` AS `Disability_Status`,\n  `candidates`.`Disability_Type` AS `Disability_Type`,\n  `candidates`.`Disability_Type_Other` AS `Disability_Type_Other`,\n  `candidates`.`Institution_Type` AS `Institution_Type`,\n  `candidates`.`Institution_Name` AS `Institution_Name`,\n  `candidates`.`Education_Level` AS `Education_Level`,\n  `candidates`.`Department` AS `Department`,\n  `candidates`.`Minor` AS `Minor`,\n  `candidates`.`Major` AS `Major`,\n  `candidates`.`Enrollement_Type` AS `Enrollement_Type`,\n  `candidates`.`Skills` AS `Skills`,\n  `candidates`.`Languages` AS `Languages`,\n  `candidates`.`English_Proficiency_Level` AS `English_Proficiency_Level`,\n  `candidates`.`Industry_Specific_Skills` AS `Industry_Specific_Skills`,\n  `candidates`.`IT_Related_Skills` AS `IT_Related_Skills`,\n  `candidates`.`Certifications` AS `Certifications`,\n  `candidates`.`Year_of_graduation` AS `Year_of_graduation`,\n  `candidates`.`Field_Of_Study` AS `Field_Of_Study`,\n  `candidates`.`GPA` AS `GPA`,\n  `candidates`.`Intervention` AS `Intervention`,\n  `candidates`.`Campaign` AS `Campaign`,\n  `candidates`.`Attend_Employability_Skill` AS `Attend_Employability_Skill`,\n  `candidates`.`DAAP_enrolled_1st Round` AS `DAAP_enrolled_1st Round`,\n  `candidates`.`DAAP_Completed` AS `DAAP_Completed`,\n  `candidates`.`DAAP_Completed_Courses` AS `DAAP_Completed_Courses`,\n  `candidates`.`Job_Fair_Clinic` AS `Job_Fair_Clinic`,\n  `candidates`.`Job_Fair` AS `Job_Fair`,\n  `candidates`.`Exit_Exam_Score` AS `Exit_Exam_Score`,\n  `candidates`.`Exit_Exam_Status` AS `Exit_Exam_Status`,\n  `candidates`.`DAAP_enrolled_2nd_Round` AS `DAAP_enrolled_2nd_Round`,\n  `candidates`.`Upload_on_Tracker` AS `Upload_on_Tracker`,\n  `candidates`.`Work_Experience` AS `Work_Experience`,\n  `candidates`.`Joined_Dereja_Services` AS `Joined_Dereja_Services`,\n  `candidates`.`Dereja_Services` AS `Dereja_Services`,\n  `candidates`.`Dereja_Training_Services` AS `Dereja_Training_Services`,\n  `candidates`.`Dereja_Event_Services` AS `Dereja_Event_Services`,\n  `candidates`.`Dereja_web_profile_completion` AS `Dereja_web_profile_completion`,\n  `candidates`.`Dereja_Information_Source` AS `Dereja_Information_Source`,\n  `candidates`.`Employment_Status` AS `Employment_Status`,\n  `candidates`.`Employment_Company` AS `Employment_Company`,\n  `candidates`.`Employment_Position` AS `Employment_Position`,\n  `candidates`.`Remark` AS `Remark`\nFROM\n  `candidates`');

